  @Test(timeout = 4000)
  public void test89()  throws Throwable  {
      Complex complex0 = Complex.ONE;
      Complex complex1 = complex0.ZERO.conjugate();
      Complex complex2 = new Complex(0.3191636800765991);
      Complex complex3 = complex2.ONE.tan();
      Complex complex4 = complex0.multiply(complex2);
      Complex complex5 = Complex.valueOf(0.3191636800765991, 0.3191636800765991);
      Complex complex6 = complex5.I.divide(0.3191636800765991);
      assertEquals(3.1331885876237564, complex6.getImaginary(), 0.01);
      assertEquals(0.0, complex6.getReal(), 0.01);
      
      Complex complex7 = complex0.multiply(0.3191636800765991);
      assertEquals(0.0, complex7.getImaginary(), 0.01);
      
      Complex complex8 = complex3.conjugate();
      Complex complex9 = complex4.INF.multiply(0.5979346036911011);
      assertEquals(Double.POSITIVE_INFINITY, complex9.getReal(), 0.01);
      
      complex8.INF.conjugate();
      assertEquals(1.557407724654902, complex8.getReal(), 0.01);
      assertEquals(-0.0, complex8.getImaginary(), 0.01);
      
      complex1.add((-4.4156343103298585E-9));
      Complex complex10 = complex4.add((-4.4156343103298585E-9));
      assertEquals(0.3191636756609648, complex10.getReal(), 0.01);
      
      Complex complex11 = (Complex)complex4.readResolve();
      assertTrue(complex11.equals((Object)complex7));
      assertEquals(0.0, complex11.getImaginary(), 0.01);
      assertFalse(complex2.isInfinite());
  }
